import React from "react";
import "./Header.scss";
import { Navbar, Nav, NavDropdown } from "react-bootstrap";

function Header() {
  return (
    //look into user specific greeting .. {Sign In || User Name}
    <Navbar className="nav__color" variant="dark" expand="md">
      <Navbar.Brand className="nav__brand" href="/">
        eShop
      </Navbar.Brand>
      <Navbar.Toggle aria-controls="basic-navbar-nav" />
      <Navbar.Collapse id="basic-navbar-nav">
        <Nav className="mr-auto">
          <Nav.Link href="/">Home</Nav.Link>
          <Nav.Link href="/login">Sign in</Nav.Link>
          <NavDropdown title="Shop" id="basic-nav-dropdown">
            <NavDropdown.Item href="/bestsellers">Whats New</NavDropdown.Item>
            <NavDropdown.Item href="#action/3.2">On Sale</NavDropdown.Item>
            <NavDropdown.Item href="#action/3.3">Categories</NavDropdown.Item>
            <NavDropdown.Divider />
            <NavDropdown.Item href="#return-policy">
              Return Policy
            </NavDropdown.Item>
            <NavDropdown.Item href="#contact-us">Contact Us</NavDropdown.Item>
          </NavDropdown>
        </Nav>
      </Navbar.Collapse>
    </Navbar>
  );
}

export default Header;
